import { SELECTED_SLOT } from "../constants";
import timeSlots from "./timeSlots.json";

const initialState = JSON.parse(timeSlots);

const timeSlotsReducer = (state = initialState, action) => {
  switch (action.type) {
    case SELECTED_SLOT:
      return {
        ...state,
        isIncrementing: true,
      };

    default:
      return state;
  }
};
export default timeSlotsReducer;
